TWComponent.script:
var k=-1;
var previoustatus = "";
   for (var k=0; k < 6;  k++) {   
     		   		tw.local.dataSeriesP[k] = new tw.object.toolkit.SYSBPMUI.DataSeries();
				tw.local.dataSeriesP[k].seriesName = tw.local.instancesStatuses[k].name;
				tw.local.dataSeriesP[k].dataPoints = new tw.object.listOf.toolkit.SYSBPMUI.DataPoint();
	var q = -1;
   		for (var l=0; l < tw.local.InstanceSummary.listLength; l ++){
   		            if(tw.local.InstanceSummary[l].name == tw.local.instancesStatuses[k].name) {
   		            q++;
				tw.local.dataSeriesP[k].dataPoints[q] = new tw.object.toolkit.SYSBPMUI.DataPoint();
   				tw.local.dataSeriesP[k].dataPoints[q].value = tw.local.InstanceSummary[l].value;
   				tw.local.dataSeriesP[k].dataPoints[q].label = tw.local.InstanceSummary[l].application;
   				}
   }
}


tw.local.multiDataSeries = tw.local.dataSeriesP;

